  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Environmental Scanning and Program
  Characteristic (ESPC) Database is in a Microsoft (MS) Access format and contains
  Medicaid and CHIP data, for the 50 states and District of Columbia. Specifically,
  the ESPC database predominantly houses information on Medicaid and CHIP program
  characteristics as well as selected environmental factors that are available through
  other publicly available databases. This database contains data from 2005 onward,
  and was last  updated in calendar year 2013. Program characteristics include data
  elements such as eligibility criteria, the presence of waiver programs, managed
  care penetration, benefit coverage, reimbursement levels, and expenditures.</p>n\",\n\t\"license_title\":
